const Home = () => {

    const handleClick = (e) => {
        console.log('Hello, ninjas', e)
    }
    const handleClickAgain = (name, event) => {
        console.log('Hello ' + name, event.target)
    }

    return (
        <div className="home">
            <h2>Homepage</h2>
            <button onClick={ handleClick }>Click me</button>
            <button onClick={ (e) => handleClickAgain('mario', e) }>Click me again</button>
        </div>
    );
}

export default Home;
